In TypeScript, you can get user input using the `readline` module, which is part of Node.js. Here's a simple example of how you can get user input:

```typescript
import * as readline from 'readline';
import * as process from 'process';

// Create an interface for the user input
interface UserInput {
    name: string;
    age: number;
}

// Initialize the readline interface
const rl = readline.createInterface({
    input: process.stdin,
    output: process.stdout
});

// Ask for user input
rl.question('What is your name? ', (answer) => {
    // Store the user's name
    const name = answer;

    rl.question('What is your age? ', (age) => {
        // Store the user's age
        const userInput: UserInput = { name, age: Number(age) };

        // Do something with the user input
        console.log(`Hello, ${userInput.name}! You are ${userInput.age} years old.`);

        // Close the readline interface
        rl.close();
    });
});
```

